var data = '';

var removed = true;

while (removed) {
  removed = false;
  for (var ndx = 0; ndx < data.length - 1; ndx++) {
    var char = data[ndx];
    var char2 = data[ndx+1];
    if (char !== char2 && char.toLowerCase() == char2.toLowerCase()) {
      data = data.substring(0, ndx) + data.substring(ndx + 2, data.length);
      removed = true;
    }
  }
}


